// src/App.js
import React from "react";
import MyNavbar from "./Navbar";

function App() {
  return (
    <div className="App">
      <MyNavbar />
      <main>
        <h1>Bem-vindo ao meu site</h1>
        <p>Conteúdo da página...</p>
      </main>
    </div>
  );
}

export default App;
